import React, { Component } from 'react';
import "material-components-web/dist/material-components-web.min.css";
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import Typography from '@material-ui/core/Typography';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Grid from '@material-ui/core/Grid';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import './Upcominglaunches.css'

const classes = theme => ({
    root: {
        flexGrow: 1,
    },
    card: {
    },
    media: {
        height: 352
    },
});

class UpcomingLaunches extends Component {

    constructor(props) {
        super(props);
        this.state = {
            UpcomingLaunches: [],
            isFetching: true
        }
    }

    componentDidMount() {
        fetch("https://api.spacexdata.com/v3/launches/upcoming")
            .then(res => res.json())
            .then((findresponse) => {
                try {
                    this.setState({
                        UpcomingLaunches: findresponse
                    })
                } catch (err) {
                    console.log(err);
                }
                console.log("response of launches", this.state.UpcomingLaunches);
            })
            .catch((err) => {
                console.log({ status: 500, message: 'Internal Server Error', err });
            })
    }

    render() {
        const { classes } = this.props;
        const { isFetching } = this.state;
        let displaydata;
        console.log("upcoming launches", this.state.UpcomingLaunches);

        // if (!isFetching && this.state.UpcomingLaunches)
        // displaydata = 
        // )

        return (
            <div className={classes.root}>
                <h2>Upcoming Launches</h2>
                <div>
                    {
                        this.state.UpcomingLaunches.map(spacedata =>
                            <Grid container spacing={3}>
                                <Grid item xs={6}>
                                    <Card className={classes.card}>
                                        <CardActionArea>
                                            <CardMedia
                                                className={classes.media}
                                                title="Contemplative Reptile"
                                            />
                                            <CardContent>
                                                <Typography gutterBottom variant="h5" component="h2">
                                                    {spacedata.rocket.rocket_name}<span>  - {spacedata.mission_name}</span>
                                                </Typography>
                                                <Typography variant="body2" color="textSecondary" component="p">

                                                </Typography>
                                            </CardContent>
                                        </CardActionArea>
                                    </Card>
                                </Grid>
                                <Grid item md={6}>
                                    <Card className={classes.card}>
                                        <CardActionArea>
                                            <CardMedia
                                                className={classes.media}

                                                title="Contemplative Reptile"
                                            />
                                            <CardContent>
                                                <Typography gutterBottom variant="h5" component="h2">
                                                    {spacedata.rocket.rocket_name && spacedata.mission_name}
                                                </Typography>
                                                <Typography variant="body2" color="textSecondary" component="p">

                                                </Typography>
                                            </CardContent>
                                        </CardActionArea>
                                    </Card>
                                </Grid>
                            </Grid>
                        )}
                </div>
            </div>

        )
    }
}
UpcomingLaunches.propTypes = {
    container: PropTypes.object,
};

export default withStyles(classes)(UpcomingLaunches);
